import React from "react";
import Listeencheres from "./components/Listeencheres";
import Historique from './components/Historique';
import Ficheenchere from './components/Ficheenchere';
import Formulaire from './components/Formulaire';
import { Route, BrowserRouter, Routes } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route exact path="/" element={<Listeencheres />} />
          <Route exact path="/historique" element={<Historique />} />
          <Route exact path="/ficheenchere" element={<Ficheenchere />} />
          <Route exact path="/formulaire" element={<Formulaire></Formulaire>} />
        </Routes>
      </BrowserRouter>
    </div >
  );
};

export default App;
